import React, { Component } from "react";

class Educated extends Component {
  state = {
    url1: "http://localhost:8000/query9_high",
    url2: "http://localhost:8000/query9_low",
  };
  render() {
    return (
      <React.Fragment>
        <h2
          id="Add2"
          style="margin-top: 3em; margin-left: 2em; margin-bottom: 0.5em"
        >
          Durchschnitt der Parteien in den 10 gebildetsten und den 10
          ungebildetsten Wahlkreisen
        </h2>
        <div class="container">
          <div class="container-child" id="query9-high">
            <img src={this.state.url1} />
          </div>
          <div class="container-child" id="query9-low">
            <img src={this.state.url2} />
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default Educated;
